Let's think step by step. To evaluate $g(f(5)-1)$, first calculate the innermost function call, $f(5)$. We substitute $5$ into the definition of $f$: $$\begin{align*}
    f(5)&=2(5)-3\\
&=10-3=\boxed{7}.
\end{align*}$$We use this result to compute $f(5)-1$: $$\begin{align*}
    g(f(5)-1)=g(7-1)=g(\boxed{6})
\end{align*}$$Now, substitute $6$ into the definition of $g$:$$\begin{align*}
    g(6)&=(6)+1\\
&=\boxed{7}.
\end{align*}$$Therefore, the value of $g(f(5)-1)$ is $7$. The answer is: 7.

